The packages and modules lists contain objects with a name and optional version attribute. The name attribute is a required string and can be an exact match, or a filesystem-like glob using * for wildcards and ? for character matching. The version attribute is an optional string can be an exact match or a filesystem-like glob of the version using * for wildcards and ? for character matching. If not provided the latest version in the repositories is used. Currently there are no differences between packages and modules in osbuild-composer. Both are treated like an rpm package dependency. When using virtual provides as the package name the version glob should be *. And be aware that you will be unable to freeze the blueprint. This is because the provide will expand into multiple packages with their own names and versions. For example, to install tmux-2.9a and openssh-server-8.* packages, add this to your blueprint: [[packages]]
name = "tmux"
version = "2.9a" [[packages]]
name = "openssh-server"
version = "8.*" Or in alternative syntax: packages = [ { name = "tmux", version = "2.9a" }, { name = "openssh-server", version = "8.*" }
]

