The groups list describes contains objects with a name-attribute. The name attribute is a required string and must match the id of a package group in the repositories exactly. groups describes groups of packages to be installed into the image. Package groups are defined in the repository metadata. Each group has a descriptive name used primarily for display in user interfaces and an ID more commonly used in kickstart files. Here, the ID is the expected way of listing a group. Groups have three different ways of categorizing their packages: mandatory, default, and optional. For the purposes of blueprints, only mandatory and default packages will be installed. There is no mechanism for selecting optional packages. For example, if you want to install the anaconda-tools group, add the following to your blueprint: [[groups]]
name = "anaconda-tools" Or in alternative syntax: groups = [ { name = "anaconda-tools" }
]

