Prerequisites koji-osbuild version >= 10 osbuild-composer version >= 58 Details Images built via the Koji integration can be automatically uploaded to the appropriate cloud environment, in addition to the Koji instance. In order for this to happen, one must provide upload_options when using the osbuildImage task and the integrated osbuild-composer instance must be configured appropriately to be able to upload to the respective cloud environments. Currently supported upload_options are: AWS EC2 AWS S3 Azure (as an image) GCP Container registry Please note, that each image type can be uploaded only to its respective cloud target, represented by upload_options (e.g. the ami image can be uploaded only to AWS EC2, gce image can be uploaded only to GCP, etc.). The allowed upload_options schema is defined in the koji-osbuild Hub plugin and currently matches the osbuild-composer Cloud API UploadOptions . If the compose request contains multiple image requests (meaning that multiple images will be built), the provided upload_options will be used as is for all images (with all its consequences). All the necessary data to locate the image in the cloud is attached by the koji-osbuild plugin to the image build task in Koji as compose-status.json file. Below is an example of such file: { "image_statuses": [ { "status": "success", "upload_status": { "options": { "ami": "ami-02e34403c421dfc17", "region": "us-east-1" }, "status": "success", "type": "aws" } } ], "koji_build_id": 1, "koji_task_id": null, "status": "success"
} Note: Starting with osbuild-composer version 91, the cloud upload target results are also attached to the image output metadata as well as to the build metadata. See the Image outout metadata section for more details. Cloud upload via koji-cli In order to upload images to the cloud when using koji-cli, one must first create a JSON file with the appropriate upload_options . Example gcp_upload_options.json: { "region": "eu", "bucket": "my-bucket", "share_with_accounts": ["alice@example.org"]
} Then add the --upload-options=gcp_upload_options.json argument to the command line when calling koji CLI. Cloud upload via Pungi In order to upload images to the cloud, when using Pungi to trigger image builds, one must specify the upload_options option in the configuration dictionary as described in the project documentation . Please note that the support for cloud upload has been merged to the Pungi project after the 4.3.6 release. Therefore, if you want to take advantage of this feature, make sure to use version higher than 4.3.6 .

